import React, { useEffect, useState } from "react";
import axios from "axios";
export default function ShowCatogery() {
  var [user] = useState("n");
  useEffect(() => {
    console.log("Call Category API.");
  });
  axios
    .post("http://localhost:8080/show-Categories")
    .then((result) => {
      console.log(result.data);
    })
    .catch((error) => {
      console.log(error);
    });

  return <div>{user}</div>;
}
